import React, {Component} from 'react';


export default class Registration  extends Component{
    constructor(props){
        super(props);

        this.state = {snackbaropen: false, snackbarmsg: ''};
        this.handleSubmit = this.handleSubmit.bind(this);

    }
    

    handleSubmit(event){
        event.preventDefault();
        fetch('http://localhost:49902/api/Registration/Create',{
          method:'POST',
          headers:{
            'Accept':'application/json',
            'Content-Type':'application/json'
          },
          body:JSON.stringify({
            CID:null,
             First_Name: event.target.First_Name.value,
             Last_Name: event.target.Last_Name.value,
             DOB: event.target.DOB.value,
             Country: event.target.Country.value,
             Nationality: event.target.Nationality.value,
             Email: event.target.Email.value,
             Alternate_Email: event.target.Alternate_Email.value,
             Phone_no: event.target.Phone_no.value,
             Password: event.target.Password.value
             
          })
        })
        .then(res=> res.json())
        .then((result)=>
        {
            alert(result);
           
        },
        (error)=>{
          alert('Failed')
          
        }
        )
    }
  

    render(){
        return(
          <div className="container">
            <form >
           <label>First_Name</label>
           <input type="text" name="First_Name" required />
           <label>Last_Name</label>
           <input type="text" name="Last_Name" required />
           <label>DOB</label>
           <input type="text" name="DOB" required />
           <label>Country</label>
           <input type="text" name="Country" required />
           <label>Nationality</label>
           <input type="text" name="Nationality" required />
           <label>Email</label>
           <input type="text" name="Email" required />
           <label>Alternate_Email</label>
           <input type="text" name="Alternate_Email" required />
           <label>Phone_no</label>
           <input type="text" name="Phone_no" required />
           <label>Password</label>
           <input type="text" name="Password" required />
           <input type="submit" >submit</input>
           </form>

         
          
         

      </div>
        );
    }

}
